script: |
  super -f text -I q1565.spq | sort > q1565.out

inputs:
  - name: q1565.spq
    data: |
      SELECT DISTINCT - 15 AS col0 FROM tab0 (FORMAT parquet) WHERE 83 NOT IN ( - col2 + + ( - ( + - col0 ) ) + + + col0 + + col0 + col1 * - - ( col2 ) );
  - name: tab0

outputs:
  - name: q1565.out
    data: |
      -15
